import "./Projects.css";
import ProjectComponent from "../ProjectComponent/ProjectComponent";

const projects = [
  {
    id: 1,
    name: "Albe",
    desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum varius \
     neque sit amet faucibus sollicitudin. Nulla lacinia venenatis felis sit amet lobortis. \
     Ut cursus fringilla iaculis. Ut egestas gravida tellus, in rhoncus \
     leo feugiat eu. Mauris hendrerit dapibus libero nec accumsan. Proin volutpat \
     eget enim id commodo. Nunc dictum felis sit amet lorem lobortis, in suscipit \
     enim vulputate.",
  },
  {
    id: 2,
    name: "FixMyForm",
    desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum varius \
     neque sit amet faucibus sollicitudin. Nulla lacinia venenatis felis sit amet lobortis. \
     Ut cursus fringilla iaculis. Ut egestas gravida tellus, in rhoncus \
     leo feugiat eu. Mauris hendrerit dapibus libero nec accumsan. Proin volutpat \
     eget enim id commodo. Nunc dictum felis sit amet lorem lobortis, in suscipit \
     enim vulputate.",
  },
];

function Projects(props) {
  return (
  <div id="project-container">
    {projects.map(project => (
      <ProjectComponent key={project.name} name={project.name} desc={project.desc}/>
    ))}
  </div>);
}

export default Projects;
